import React from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => (
    <div style={{
      color: 'white', 
      background: 'grey',
      padding: '15px 10px',
      display: 'inline-flex',
      textAlign: 'center',
      alignItems: 'center',
      justifyContent: 'center',
      borderRadius: '100%',
      transform: 'translate(-50%, -50%)'
    }}>
      {text}
    </div>
  );

function SimpleMap({center, zoom}) {



      return (
        <div className="simpleMap" style={{height:'200px', width:'200px'}}>
         <GoogleMapReact
          defaultCenter={center}
          defaultZoom={zoom}
        >
          <AnyReactComponent 
            lat={5.302464031517254} 
            lng={-4.083204497062938} 
            text={'Misouah'} 
          />
        </GoogleMapReact>
        </div>
      );

} 

export default SimpleMap
